import React from "react";
import Card from "./Card";

const CardList = ({vegetables})=>{
    const cardComponent = vegetables.map((vegetable, i)=>{
        return                 <Card id={vegetables[i].id} name={vegetables[i].name} season={vegetables[i].season} />

    })
        return(
            <div>
                {cardComponent}
            </div>
    );
}

export default CardList;
